import React, { Component } from 'react';
import { StyleSheet, View, Text } from 'react-native';



export default function TopTime(props) {

  return (
    <View style={styles.container}>
      <Text style={styles.topTimeText}>1700</Text>
      <Text style={styles.bottomTimeText}>09:00 PM</Text>
    </View>
  );

}
const styles = StyleSheet.create({
  container: {
    backgroundColor: '#fff',
  },
  topTimeText: {
    textAlign: "center",
    fontSize: 100,

  },
  bottomTimeText: {
    textAlign: "center",
    fontSize: 40,

  }

});
